<?phpnamespace Nemundo\Meteo\Zamg\Data\Wetterkarte;class WetterkartePaginationReader extends \Nemundo\Model\Reader\AbstractPaginationModelDataReader {/*** @var WetterkarteModel*/public $model;public function __construct() {parent::__construct();$this->model = new WetterkarteModel();}/*** @return WetterkarteRow[]*/public function getData() {$list = [];foreach (parent::getData() as $dataRow) {$row = new WetterkarteRow($dataRow, $this->model);$list[] = $row;}return $list;}}